import { render } from 'react-dom';

import { Pannellum } from "pannellum-react";
import myImage from "./images/alma.jpg";

import {
    StyleSheet, Button, View, SafeAreaView,
    Text, Alert
} from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#71EC4C',
        alignItems: 'center',
        justifyContent: 'center',
    },
});

const PannellumReact = (props) => (
  <div>
    <Pannellum
        width="100%"
        height="1000px"
        image={myImage}
        pitch={10}
        yaw={180}
        hfov={110}
        autoLoad
        onLoad={() => {
            console.log("panorama loaded");
        }}
    >
    <Button
      title="Button 1"
      onPress={() => Alert.alert(
        'Its GeeksforGeeks !')}
    />
    </Pannellum>
    <Button
      title="Button 2"
      onPress={() => Alert.alert(
        'Its GeeksforGeeks !')}
    />
  </div>
);

export default PannellumReact;
